Ditzy city girl Kristina gets more than a dose of Southern hospitality when she wanders into a roadside store in the middle of nowhere and begins mocking small town ways. Katia, a hick who doesn't take too kindly to smart mouthed city slickers, takes it upon herself to teach Kristina that sometimes insults can come back to fuck you in the ass.
